import React, {useState} from 'react'
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import {useHistory} from 'react-router-dom';
import { Card, CardTitle, CardText, Row, Col } from 'reactstrap';
const EnterChat = (props) => {
    
    const [name, setName] = useState("");

    const sendName = (e) =>{
       console.log(e.target);
    }



    return (
        <div className="container">
        <h5 style={{marginTop:10}}>Public list of available rooms!</h5>
        <Row style={{marginTop:50}}>
      <Col sm="4">
        <Card body>
          <CardTitle>React.js</CardTitle>
          <CardText>Talk about your experience with React and make new connections!</CardText>
          <Button style={{backgroundColor:'blue', color:'white'}}>Join room</Button>
        </Card>
      </Col>
      <Col sm="4">
        <Card body>
          <CardTitle>Vue.js</CardTitle>
          <CardText>Talk about your experience with Vue and make new connections!</CardText>
          <Button className="Vue" style={{backgroundColor:'blue', color:'white'}} onClick={sendName}>Join room</Button>
        </Card>
      </Col>
      <Col sm="4">
        <Card body>
          <CardTitle>Angular.js</CardTitle>
          <CardText>Talk about your experience with Angular and make new connections!</CardText>
          <Button style={{backgroundColor:'blue', color:'white'}}>Join room</Button>
        </Card>
      </Col>
    </Row>
        </div>
    )
}

export default EnterChat;
